    def __init__(self):
        HTMLParser.__init__(self)
        self.data = []

    def handle_starttag(self, tag, attrs):
        pass

    def reporthtmlparser(self, reportResults, trs=None):
        i = 0
        for report in reportResults:
            i = i + 1
            requestLog = self.reporthtmllog(report['requestLog'], '')
            resultLog = self.reporthtmllog(report['resultLog'], '')
            status = self.reportstatus(report['status'])
            re_color = self.reportstatusColor(report['status'])
            trs += "<tr style='font-family: Consolas'><td>" + str(i) + '</td><td>' + report['scenario'] + '</td><td>' + report['serviceName'] + '</td><td>' + report['methodName'] + '</td><td>' + report['description'] + '</td><td>' + report['spendTime'] + "</td><td style='color:" + re_color + "'>" + report['status'] + "</td></tr> <tr style='display:" + status + "'><td colspan='" + str(8) + "'><div style='font-family: Consolas;font-size:12px'>" + resultLog + '</div></td></tr>'

        return trs

    def reporthtmllog(self, logs, logstr=None):
        for log in logs:
            logstr += '<p>' + log + '</p>'

        return logstr

    def reportstatus(self, status):
        if status == '失败':
            return ''
        return 'none'

    def reportstatusColor(self, status):
        if status == '失败':
            return 'red'
        return ''

    def handle_endtag(self, tag):
        pass

    def handle_data(self, data):
        if data.count('\n') == 0:
            self.data.append(data)